SELECT MIN(aka_title.movie_id), MIN(complete_cast.movie_id), MIN(cast_info.movie_id), MIN(movie_companies.company_id), MIN(title.id), MIN(title.episode_nr), MIN(title.title), MIN(company_name.country_code), MIN(movie_link.linked_movie_id), MIN(title.kind_id), MIN(movie_info.movie_id), MIN(movie_link.movie_id), MIN(movie_companies.movie_id), MIN(movie_keyword.movie_id), MIN(company_name.id), MIN(kind_type.id) FROM movie_link, kind_type, company_name, movie_companies, movie_info, cast_info, movie_keyword, aka_title, complete_cast, title WHERE company_name.country_code IN ('[es]', '[th]', '[na]', '[gl]', '[mn]', '[ki]', '[au]', '[ca]', '[in]', '[ee]', '[jp]', '[gb]', '[bg]', '[fr]', '[kr]', '[bm]', '[ve]', '[de]', '[us]', '[it]') AND title.episode_nr NOT BETWEEN 66530 AND 74856 AND title.title IS NOT NULL AND movie_info.movie_id = title.id AND title.id = movie_link.movie_id AND company_name.id = movie_companies.company_id AND kind_type.id = title.kind_id AND title.id = cast_info.movie_id AND title.id = movie_link.linked_movie_id AND movie_companies.movie_id = title.id AND title.id = complete_cast.movie_id AND title.id = aka_title.movie_id AND title.id = movie_keyword.movie_id;